import React from 'react';
import Header from './Header.jsx';

function AdminFeature(){
    return (
        <div>
            <Header />
            <section class="text-center">
            <h1 class="section-title">Administrator Feature Assignment</h1>
            <form class="feature-form">
                <div class="form-group row">
                    <label class="col-sm-2 col-form-label">Photo:</label>
                    <input class="form-control col-sm-10" type="text" placeholder="Paste photo url here"></input>
                </div>
                <div class="form-group row">
                    <label class="col-sm-2 col-form-label">Feature Title: </label>
                    <input class="form-control col-sm-10" type="text" placeholder="type the title of the feature here" />
                </div>
                
                <button class="btn btn-lg submit-btn" type="submit">Submit</button>
            </form>
            </section>
        </div>
    );
}

export default AdminFeature;
